import image from "../image"
import {Link} from 'react-router-dom'
function Top() {
    let css = {
        top : {
            width: '100%',
            height: '70px',
            backgroundColor: '#0A121F',
            display: 'flex',
            justifyContent: 'space-around',
            alignItems: 'center',
            color: 'white',
            //0E1231FF

        },
        topImg : {
            height: '57px',

        },
        ul : {
            listStyleType: 'none',
            width: '450px',
            display: 'flex',
            justifyContent: 'space-between',
        },
        li : {
            fontSize: '16px',
        },
        button : {
            width: '100px',
            height: '50px',
            border: 'none',
            borderRadius: '5px',
            backgroundColor: '#3A68B8',
            color: 'white',
            fontSize: '16px'
        }
    }

    return (
        <div style={css.top}>
            <img src={image.logo} alt="логотип" style={css.topImg}/>
            <ul style={css.ul}>
                <li><Link to='/p' style={css.li}>Home</Link></li>
                <li><Link to='' style={css.li}>About</Link></li>
                <li><Link to='' style={css.li}>Services</Link></li>
                <li><Link to='' style={css.li}>Blog</Link></li>
                <li><Link to='' style={css.li}>Contact</Link></li>
            </ul>
            <button style={css.button}>Sign In</button>


        </div>
    );
}

export default Top;
